// ------------------ ┌∩┐(◣_◢)┌∩┐ ------------------
import React, {Component} from 'react';
import {  Container, Jumbotron, Row, Col, Button } from 'reactstrap';

import "../basics.css";
// ------------------ ┌∩┐(◣_◢)┌∩┐ ------------------
class ColRow3 extends Component{

// ------------------ '(◣_◢)' ------------------
  render(){
    return(
      <div className="svg_backs_slant_gun">
      <br />
      <br />
        <div className="container">
            <div className="row">
                    <div className=" col-md-4">
                       <h3 className="orange-font" style={{textAlign: "center",fontSize: "28px"}}>Absorb</h3>
                       <p className="white-font" style={{textAlign: "center"}}>from nature; OS code snippets, modern farming techniques & filthy basslines.</p>
                         <p className="white-font" style={{textAlign: "center"}}>We are interested in the world.</p>
                          <div className="text-center">
                              <img src={'https://upload.wikimedia.org/wikipedia/commons/5/5e/%C3%86toms_-_Earth.svg'} className="img-fluid" style={{width: "60%", height: "60%"}} alt={"The World"} />
                          </div>
                          <br />
                    </div>
                    <br />
                    <div className=" col-md-4">
                        <h3 className="orange-font" style={{textAlign: "center",fontSize: "28px"}}>Transform</h3>
                        <p className="white-font" style={{textAlign: "center"}}>for individuals; developers, entrepreneurs & musicians.</p>
                        <p className="white-font" style={{textAlign: "center"}}> We develop interface solutions.</p>
                          <div className="text-center">
                              <img src={'https://image.flaticon.com/icons/svg/1495/1495282.svg'} className="img-fluid" style={{width: "60%", height: "60%"}} alt={"The World"} />
                          </div>
                          <br />
                    </div>
                    <br />
                    <div className=" col-md-4">
                        <h3 className="orange-font" style={{textAlign: "center",fontSize: "28px"}}>&Deploy</h3>
                        <p className="white-font" style={{textAlign: "center"}}>to the Moon; Our product is a service. We are right by your side until safe landing. </p>
                        <p className="white-font" style={{textAlign: "center"}}> We are here to support.</p>
                          <div className="text-center">
                              <img src={'https://upload.wikimedia.org/wikipedia/commons/1/18/Creative-Tail-rocket.svg'} className="img-fluid" style={{width: "60%", height: "60%"}} alt={"The World"} />
                          </div>
                          <br />
                    </div>
                    <br />

            </div>
        </div>
        <br />
        <br />
      </div>
      );
  }
// ------------------ '(◣_◢)' ------------------
}
// ------------------° ̿ ̿'''\̵͇̿̿\з=(◕_◕)=ε/̵͇̿̿/'̿'̿ ̿ °------------------

// ------------------° ̿ ̿'''\̵͇̿̿\з=(◕_◕)=ε/̵͇̿̿/'̿'̿ ̿ °------------------
export default ColRow3;
